import React from "react";
import "./Content.css";

function Content({ content }) {
  return (
    <li>
      <div className="username">{el.username}</div>
      <div className="title">{el.title}</div>
      <div className="msg">{el.msg}</div>
    </li>
  );
}

export default Content;
